var sa = new SecurelyAccess("properties/cacerts");
var keyStoreFile = sa.getFile();
if (keyStoreFile != null && keyStoreFile.exists()) {
  // load the keystore and extract the certificates
  var keyStore = Packages.java.security.KeyStore.getInstance("JKS");
  var fileInputStream = sa.getFileInputStream();
  keyStore.load(fileInputStream, new Packages.java.lang.String("changeit").toCharArray());

  var loadedCount = 0;

  var aliases = keyStore.aliases();
  while(aliases.hasMoreElements()) {
    var alias = aliases.nextElement();

    var cert = keyStore.getCertificate(alias);

    var notAfter = cert.getNotAfter();
    var expires = new GlideDateTime(notAfter);

    var notBefore = cert.getNotBefore();
    var valid_from = new GlideDateTime(notBefore);

    var issuer = cert.getIssuerDN().getName();
    var subject = cert.getSubjectDN().getName();

    var gr = new GlideRecord("sys_certificate");
    gr.addQuery("format", "der");
    gr.addQuery("name", alias);
    gr.addQuery("issuer", issuer);
    gr.addQuery("subject", subject);
    gr.addQuery("expires", expires);
    gr.addQuery("valid_from", valid_from);
    gr.query();
    if (!gr.next()) {
      gr.initialize();
      gr.format = "der";
      gr.name = alias;
      gr.issuer = issuer;
      gr.subject = subject;
      gr.expires.setValue(expires);
      gr.valid_from.setValue(valid_from);
      gr.insert();

      var attachment = new GlideSysAttachment();
      var certBytes = cert.getEncoded();
      attachment.write(gr, "certificate.cer", "application/octet-stream", certBytes);

      loadedCount++;
    }
  }

  if (loadedCount == 0)
    gs.log("No certificates loaded");
  else
    gs.log(loadedCount + " certificates loaded");
}

