function insertNotification(message, uuid) {
  // create the soap document
  var soapdoc = new SOAPEnvelope();
  soapdoc.setFunctionName("insert");
  soapdoc.addFunctionParameter("message", message);
  soapdoc.addFunctionParameter("uuid", uuid);
  soapdoc.addFunctionParameter("source", "Test Computer");
 
  // post the request
  var soapRequest = new SOAPRequest(urlBase + "/imp_notification.do?SOAP", "admin", "admin");
  var xml = new XMLDocument(soapRequest.post(soapdoc));

  gs.print("incident number: " + xml.getNodeText("//number"));
  gs.print("action: " + xml.getNodeText("//status"));
  gs.print("message: " + xml.getNodeText("//status_message"));
}

